esantuanan , kesetiaan , kepatuhan dan hormat masyarakat Perempuan Gowa kepada laki-laki. Pola gerakan yang dimulai dengan duduk dan mulai memutar searah jarum jam juga memiliki makna adanya siklus hidup yang selalu berputar. Selain berputar, tarian ini mengarah gerakan naik turun yang melambangkan kehidupan manusia kadang berada di atas kadang berada di bawah, yang mengisyaratkan agar perlunya hidup itu harus dilalui dengan kesabaran. Secara keseluruhan tarian ini meiliki 12 gerakan yang masing-masing memiliki makna yang berbeda-beda .Aturan dalam tarian ini sangat unik, diantaranya penari tidak diperbolehkan untuk membuka mata terlalu lebar , termasuk gerakan kaki tidak boleh diangkat terlalu tinggi.Oleh karena itu fisik penari harus prima, karena harus selalu menunjukkan kelembutan dan kesantunan.","styleRuns":[{"startIndex":0,"length":1638,"styleRunExtensions":{"styleRunColorMapExtension":{"colorMap":[{"key":"USER_INTERFACE_THEME_DARK","value":4294967295},{"key":"USER_INTERFACE_THEME_LIGHT","value":4279440147}]}},"fontFamilyName":"Roboto"}]},"headerRuns":[{"startIndex":0,"length":1638,"headerMapping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"}],"backgroundColorStyle":"BACKGROUND_COLOR_STYLE_COLOR_SAMPLED","lightThemeColorPalette":{"baseBackground":4294964464,"raisedBackground":4294964464,"additiveBackground":566848837,"textPrimary":4281931271,"textSecondary":4286595624,"invertedBackground":4286595624,"overlayBackground":3426293255},"darkThemeColorPalette":{"baseBackground":4280093186,"raisedBackground":4281931271,"additiveBackground":734620997,"textPrimary":4294764511,"textSecondary":4293375649,"invertedBackground":4293106557,"overlayBackground":3426293255},"colorSampledDescriptionBodyText":{"content":"Tari Kipas Pakarena adalah sejenis tarian yang berasal dari kerajaan Gowa Makasar Sulawesi Selatan , Berasal dari kata \"karena \" yang artinya Bermain. dan \"pa\" yang berati pelakunya. Tarian ini menjadi kekuatan tradisi budaya masyarakat Gowa yang sudah ber
